'use strict';

module.exports = {
  root: true,
  extends: ['eslint:recommended', 'plugin:prettier/recommended'],
  parserOptions: {
    ecmaVersion: 2022,
    sourceType: 'module',
  },
  rules: {
    'no-shadow': 'error',
    'no-var': 'error',
    'padding-line-between-statements': [
      'error',
      // Require newline before return
      { blankLine: 'always', prev: '*', next: 'return' },
      // Require newline after a batch of variable declarations
      { blankLine: 'always', prev: ['const', 'let', 'var'], next: '*' },
      {
        blankLine: 'any',
        prev: ['const', 'let', 'var'],
        next: ['const', 'let', 'var'],
      },
      {
        blankLine: 'never',
        prev: ['import'],
        next: ['import'],
      },
    ],
    'prefer-const': 'error',
  },
  env: {
    node: true,
    es6: true,
  },
  overrides: [
    {
      files: ['**/*.cjs'],
      parserOptions: {
        ecmaVersion: 2020,
        sourceType: 'script',
      },
      rules: {
        strict: ['error', 'global'],
      },
    },
    {
      files: ['**/*.ts', '**/*.tsx'],
      parser: '@typescript-eslint/parser',
      plugins: ['@typescript-eslint'],
      extends: [
        'plugin:@typescript-eslint/recommended',
        'plugin:@typescript-eslint/strict',
        'plugin:@typescript-eslint/stylistic',
      ],
      rules: {
        'no-shadow': 'off',
        '@typescript-eslint/no-shadow': 'error',
        '@typescript-eslint/array-type': ['error', { default: 'array-simple' }],
        '@typescript-eslint/consistent-type-imports': 'error',
        //'@typescript-eslint/no-duplicate-imports': 'error', //import plugin
        '@typescript-eslint/no-non-null-assertion': 'off',
        '@typescript-eslint/sort-type-constituents': 'error',
      },
    },
  ],
};

export default {
  arrowParens: 'always',
  trailingComma: 'all',
  useTabs: false,
  printWidth: 80,
  proseWrap: 'always',
  singleQuote: true,
  plugins: ['prettier-plugin-tailwindcss'],
};

{
  "$schema": "https://docs.renovatebot.com/renovate-schema.json",
  "labels": [
    "dependencies"
  ],
  "extends": [
    "config:recommended",
    ":pinOnlyDevDependencies"
  ],
  "enabled": true,
  "lockFileMaintenance": {
    "enabled": true,
    "semanticCommitType": "chore",
    "automerge": true
  },
  "semanticCommits": "enabled",
  "semanticCommitType": "fix",
  "automergeType": "branch",
  "packageRules": [
    {
      "matchFileNames": [
        "benchmark/package.json",
        "packages/website/package.json",
        "packages/react-docgen-cli/package.json"
      ],
      "extends": [
        ":pinAllExceptPeerDependencies"
      ]
    },
    {
      "matchDepTypes": [
        "devDependencies"
      ],
      "semanticCommitType": "chore"
    },
    {
      "matchDepTypes": [
        "devDependencies"
      ],
      "matchUpdateTypes": [
        "minor",
        "patch"
      ],
      "automerge": true
    },
    {
      "matchPackageNames": [
        "pnpm"
      ],
      "matchUpdateTypes": [
        "minor",
        "patch"
      ],
      "automerge": true
    },
    {
      "matchPackageNames": [
        "@types/node"
      ],
      "matchUpdateTypes": [
        "major"
      ],
      "enabled": false
    },
    {
      "matchFileNames": [
        "benchmark/package.json",
        "packages/website/package.json"
      ],
      "matchUpdateTypes": [
        "minor",
        "patch"
      ],
      "automerge": true
    },
    {
      "matchFileNames": [
        "benchmark/package.json",
        "packages/website/package.json"
      ],
      "semanticCommitType": "chore"
    },
    {
      "enabled": false,
      "matchPackageNames": [
        "/^react-docgen/"
      ]
    }
  ]
}
